import React, {useState} from "react";
import { Row, Col, Container, Jumbotron, Button } from "react-bootstrap";

const LatestAttendance = () => {
  const [data, setData] = useState([]);

  const getData = async () => {
    await fetch("/aws/api")
      .then((res) => res.json())
      .then((res) => setData(res.sheets));
  };

  useEffect(() => {
    getData();
  }, []);
  
  return (
    <>
      <Container className="latest-attendance text-center" fluid>
        <h3 style={{ color: "white", textAlign: "left" }}>Latest Attendance</h3>
        <Row>
          <Col>
            <Jumbotron
              style={{
                backgroundColor: "white",
                width: "auto",
                height: "auto",
              }}
            >
              <h3>CE-D21</h3>
              <Button>19 / 24</Button>
            </Jumbotron>
          </Col>
          <Col>
            <Jumbotron
              style={{
                backgroundColor: "white",
                width: "auto",
                height: "auto",
              }}
            >
              <h3>CE-D21</h3>
              <Button>19 / 24</Button>
            </Jumbotron>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default LatestAttendance;
